import React from 'react';
import Tilt from 'react-tilt';
import "./Logo.css";
 
const Logo = () => {
	return (
		<div className='ma4 mt0'>
			<Tilt className="br2 shadow-2 ba b--yellow-20 Tilt" options={{ max : 25 }} style={{ height: 80, width: 100 }} >
				 <div className="Tilt-inner white">
				 		<img src='https://chriskeehk.github.io/QITS/qits-logo-v2.svg'/>
				 </div>
			</Tilt>
		</div>
	);
}

export default Logo;
